Bad Advice (Jonathan Morgan, Wicked Pictures / DvdRip / 2015) 

Most people have the best intentions, but not always! Pampered housewife Karen has little to do besides listen to gossip at the salon. But when the topic turns to her own husbands infidelity, she goes off the rails and the accusations fly! Now convinced of his cheating ways, she starts her own journey through online dating with sexy, exciting and unexpected results. Bad Advice. You never know where it's going to land you!

Brandi Love, Janet Mason, Katrina Jade, Keira Nicole, Kleio Valentien, Sarah Vandella

